import axios from "axios";

export const storeContent = async(chatData) => {
    console.log('chatData: ', chatData);
    try {
        const response = await axios.post('http://localhost:3001/api/storechatdata', chatData,{
            headers: {
                'Content-Type': 'application/json',
            },
        
        });  // send data to server
        if(!response){
            throw new Error("Cannot store data!")
           }
     return response.data;
    } catch (error) {
        console.log("Error store data!",error)
        return { error: error.response?.data?.error || "พบข้อผิดพลาดบางอย่าง" };
      }
}
